export default {
  state() {
    return {
    };
  },
  mutations: {
  },
  actions: {
    logout(auth0) {
      console.log('logout')
      console.log(`store auth0: ${auth0}`)
      $auth0.logout({
        logoutParams: {
          returnTo: window.location.origin
        }
      });
    }
  },
  getters: {
  }
}
